	},
	getStudentRoom: function() {
		return (new Housing()).getStudentRoom();
	},
	getStudentFloor: function() {
		return (new Housing()).getStudentFloor();
	},
	getStudentCampus: function() {
		return (new Housing()).getStudentCampus();
	},
    type: 'AjaxHousing'
});
